INSERT INTO `b_email_templates` (`id`, `email_name`, `email_subject`, `email_content`, `email_keywords`, `template_type`) VALUES
(1, 'User Subscription', 'Maadima: User Subscription', '<p><font face="Cambria"><span style="font-size: 12px;">Dear Subscriber,</span></font></p><span style="font-size: 12px;">\r\n</span><p><font face="Cambria"><span style="font-size: 12px;">You have successfully subscribed at [WEBSITE_LINK] with email address [USER_EMAIL]</span></font></p><span style="font-size: 12px;">\r\n</span><p><font face="Cambria"><span style="font-size: 12px;">Regards,</span><br><span style="font-size: 12px;">\r\nGreenTIP Team</span></font></p>\r\n', '[USER_EMAIL], [UNSUBSCRIBE_LINK], [WEBSITE_LINK]', 'email'),
(2, 'User Registration', 'Maadima: User Registration', '<p><font face="Cambria"><span style="font-size: 12px;">Dear [NAME],</span></font><span style="font-size: 12px;">﻿</span></p><span style="font-size: 12px;">\r\n</span><p><font face="Cambria"><span style="font-size: 12px;">Thank you for your registration and we warmly welcome you to green tip.</span></font></p><p><font face="Cambria"><span style="font-size: 12px;">Please&nbsp; [VERIFY_LINK] to activate your account.</span><br></font></p><span style="font-size: 12px;">\r\n</span><p><font face="Cambria"><span style="font-size: 12px;">Regards,</span><br><span style="font-size: 12px;">\r\nGreenTIP Team</span></font></p>', '[NAME], [EMAIL], [VERIFY_LINK]', 'email'),
(3, 'Activation Email', 'Maadima: Activation Email', '<p><font face="Cambria"><span style="font-size: 12px;">Dear [NAME],</span></font></p><span style="font-size: 12px;">\r\n</span><p><font face="Cambria"><span style="color: rgb(85, 85, 85); font-size: 12px;">Your account has been activated. Thanks for joining us.&nbsp;</span><br></font></p><span style="font-size: 12px;">\r\n</span><p><font face="Cambria"><span style="font-size: 12px;">Regards,</span><br><span style="font-size: 12px;">\r\nGreenTIP Team</span></font></p>', '[NAME]', 'email'),
(21, 'OTP Email', 'Maadima: VERIFICATION EMAIL ', '<p>Hi [NAME]</p>\n<p>Your verification OTP to verify <a href="mailto:[USER_EMAIL]">[USER_EMAIL]</a>&nbsp; is  [OTP] <br /> </p>\n<p>If this wasn&rsquo;t you, please disregard this email. Your email was sent by error</p>\n<p><strong>Talk to us</strong><br /> If you have any questions about the letter, or would like more information regarding our services, please call us using the contact details given below. <br /> </p>\n<p>Sincerely;</p>\n<p>Maadima<br /> <br /> <strong>Help Desk</strong> <br /> 011 019 3100 <br /> <a href="mailto:help.cs@maadima.com">help.cs@maadima.com</a> &nbsp;&nbsp;</p>', '[NAME],[USER_EMAIL],[OTP],[CELL],[PASSWORD]', 'email'),
(25, 'Welcome email', 'Maadima: WELCOME EMAIL', '<p>Dear [NAME]</p>\n<p>Thank you for registering and choosing Maadima for your business requirements. .</p>\n<p>You are receiving this email because an account was recently created for you on the Maadima app. <br /> <br /> Please find your login credential below :</p>\n<table>\n<tbody>\n<tr>\n<td>\n<p>Username:</p>\n</td>\n<td>\n<p>[USER_EMAIL]</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Password:</p>\n</td>\n<td>\n<p>[PASSWORD]</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>If you have any problems verifying your account, please send an email to <a href="mailto:help.cs@maadima.com">help.cs@maadima.com</a>&nbsp; for assistance.</p>\n<p>For telephonic assistance, please call the Support Desk 011 019 3100, during office hours:</p>\n<table>\n<tbody>\n<tr>\n<td>\n<p>Monday to Thursday:</p>\n</td>\n<td>\n<p>08h00 to 17h00</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Fridays:</p>\n</td>\n<td>\n<p>08h00 to 15h30</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>Sincerely,<br /> Maadima<br /> <br /> <strong>Help Desk</strong> <br /> 011 019 3100 <br /> <a href="mailto:help.cs@maadima.com">help.cs@maadima.com</a> &nbsp;&nbsp;</p>', '[NAME],[USER_EMAIL],[PASSWORD]', 'email'),
(20, 'Quote Approve Email', 'Maadima: Quote Approve Email Request By Admin', '<h3 style="font-weight: 700; line-height: 30px; color: rgb(34, 34, 34); margin-top: 0px; margin-bottom: 0px; font-size: 20px;"><span style="font-size: 12px;">\r\n\r\n<font face="Cambria">We received a request to approve your quote</font>\r\n\r\n</span></h3>\r\n\r\n\r\n<p>\r\n<span style="font-size: 12px;">\r\n<font face="Cambria">Dear [NAME],</font>\r\n</span>\r\n</p>\r\n\r\n<p>\r\n<font face="Cambria">\r\n<span style="color: rgb(34, 34, 34); font-size: 12px;">\r\nYour quote is approve by the admin.<br>\r\nAdmin reply :   [ADMIN_REPLY]\r\n</span>\r\n<br>\r\n</font>\r\n</p>\r\n\r\n<p>\r\n<font face="Cambria">\r\n<span style="font-size: 12px;">Regards,</span>\r\n<br>\r\n<span style="font-size: 12px;">\r\nMaadima Team\r\n</span>\r\n</font>\r\n</p>', '[NAME],[ADMIN_REPLY]', 'email'),
(14, 'End User Registration By Admin', 'GreenTIP: End User Registration', '<p><font face="Cambria"><span style="font-size: 12px;">Dear [NAME],</span></font></p><p><font face="Cambria"><span style="font-size: 12px;">Your profile has been created by admin</span></font></p><p><font face="Cambria"><span style="font-size: 12px;">Use the following values when prompted to login:</span></font></p><p><font face="Cambria"><span style="font-size: 12px;">Email: [EMAIL]</span></font></p><p><font face="Cambria"><span style="font-size: 12px;">Password: [PASSWORD]</span></font></p><p><font face="Cambria"><span style="font-size: 12px;">Login Link: [LOGIN_LINK]</span></font></p><p><font face="Cambria"><span style="font-size: 12px;">Regards,</span><br><span style="font-size: 12px;">GreenTIP Team</span></font></p>', '[NAME],[PASSWORD], [EMAIL],[LOGIN_LINK]', 'email'),
(19, 'Account Login Details', 'Maadima: We received a account login request', '<h3 style="font-weight: 700; line-height: 30px; color: rgb(34, 34, 34); margin-top: 0px; margin-bottom: 0px; font-size: 20px;"><span style="font-size: 12px;">\n\n<font face="Cambria">Login Credential Details : </font>\n\n</span></h3>\n\n\n<p>\n<span style="font-size: 12px;">\n<font face="Cambria">Dear [NAME],</font>\n</span>\n</p>\n\n<p>\n<font face="Cambria">\n<span style="color: rgb(34, 34, 34); font-size: 12px;">\nYour username is : [USER_EMAIL]\n</span>\n<br>\n</font>\n</p>\n\n<p>\n<font face="Cambria">\n<span style="color: rgb(34, 34, 34); font-size: 12px;">\nYour password is : [PASSWORD]\n</span>\n<br>\n</font>\n</p>\n\n\n<p>\n<font face="Cambria">\n<span style="font-size: 12px;">Regards,</span>\n<br>\n<span style="font-size: 12px;">\nMaadima Team\n</span>\n</font>\n</p>', '[NAME],[USER_EMAIL],[PASSWORD]', 'email'),
(16, 'Reset Password', 'Maadima: PASSWORD RESET ', '<p>Dear [NAME]</p>\n<p>Your one time password is <strong>[PASSWORD]</strong>, Kindly login and create your new password</p>\n<p><strong>Talk to us</strong><br /> If you have any questions about the letter, or would like more information regarding our services, please call us using the contact details given below.</p>\n<p>Sincerely;</p>\n<p>Maadima<br /> <br /> <strong>Help Desk</strong> <br /> 011 019 3100 <br /> <a href="mailto:help.cs@maadima.com">help.cs@maadima.com</a> &nbsp;&nbsp;</p>\n', '[NAME],[USER_EMAIL],[PASSWORD]', 'email'),
(17, 'Account Approved Email', 'RaS E-Tender: We received a account approved request', '<h3 style="font-weight: 700; line-height: 30px; color: rgb(34, 34, 34); margin-top: 0px; margin-bottom: 0px; font-size: 20px;"><span style="font-size: 12px;">\r\n\r\n<font face="Cambria">We received a request to approved your account</font>\r\n\r\n</span></h3>\r\n\r\n\r\n<p>\r\n<span style="font-size: 12px;">\r\n<font face="Cambria">Dear [NAME],</font>\r\n</span>\r\n</p>\r\n\r\n<p>\r\n<font face="Cambria">\r\n<span style="color: rgb(34, 34, 34); font-size: 12px;">\r\nYour account is approved by the admin.\r\n</span>\r\n<br>\r\n</font>\r\n</p>\r\n\r\n\r\n<p>\r\n<font face="Cambria">\r\n<span style="font-size: 12px;">Regards,</span>\r\n<br>\r\n<span style="font-size: 12px;">\r\nRaS E-Tender Team\r\n</span>\r\n</font>\r\n</p>\r\n', '[NAME],[USER_EMAIL]', 'email'),
(18, 'Account Reject Email', 'RaS E-Tender: We received a account reject request', '<h3 style="font-weight: 700; line-height: 30px; color: rgb(34, 34, 34); margin-top: 0px; margin-bottom: 0px; font-size: 20px;"><span style="font-size: 12px;">\r\n\r\n<font face="Cambria">We received a request to reject your account</font>\r\n\r\n</span></h3>\r\n\r\n\r\n<p>\r\n<span style="font-size: 12px;">\r\n<font face="Cambria">Dear [NAME],</font>\r\n</span>\r\n</p>\r\n\r\n<p>\r\n<font face="Cambria">\r\n<span style="color: rgb(34, 34, 34); font-size: 12px;">\r\nYour account is rejectd by the admin.\r\n</span>\r\n<br>\r\n</font>\r\n</p>\r\n\r\n<p>\r\n<font face="Cambria">\r\n<span style="color: rgb(34, 34, 34); font-size: 12px;">\r\nPlease conatct to adminstrator to approved your account.\r\n</span>\r\n<br>\r\n</font>\r\n</p>\r\n\r\n<p>\r\n<font face="Cambria">\r\n<span style="font-size: 12px;">Regards,</span>\r\n<br>\r\n<span style="font-size: 12px;">\r\nRaS E-Tender Team\r\n</span>\r\n</font>\r\n</p>', '[NAME],[USER_EMAIL]', 'email'),
(22, 'Payment success', 'Maadima: PAYMENT SUCCESS', '<p>Dear <strong>[NAME]</strong></p>\n<p>Thank you for successful payment and choosing myMaadima for your project financial needs.</p>\n<p>You are receiving this email because you have done successful payment on the Maadima plateform. Please<br />find payments and plan detail below:</p>\n<p>Payment Details</p>\n<ul style="list-style-type: circle;">\n<li>Transaction Id:&nbsp;&nbsp;[TRANSACTIONID]</li>\n<li>Transaction Reference:&nbsp; &nbsp;[TRANSACTIONREFERENCE]</li>\n<li>Status Message:&nbsp; &nbsp;[STATUSMESSAGE]</li>\n</ul>\n<hr>\n<p>Plan Details</p>\n<ul style="list-style-type: circle;">\n<li>Plan Type:&nbsp;&nbsp;[PLAN_TYPE]</li>\n<li>Plan Start Date:&nbsp; &nbsp;[PLANSTARTDATE]</li>\n<li>Plan End Date:&nbsp; &nbsp;[PLANENDDATE]</li>\n</ul>\n<p>If you have any problem, please send an email to <strong>clientcare@maadima.com</strong> assistance</p>\n<p>For telephonic assistance; please call the Help Desk on 011 019 3100, during office hours:</p>\n<p>Monday to Thursday:&nbsp; &nbsp; &nbsp;<strong>08h00 to 17h00</strong><br />Fridays:&nbsp; &nbsp;<strong> 08h00 to 15h30</strong></p>\n<p>Thank you,<br />Maadima Anywhere</p>', '[NAME],[USER_EMAIL],[TRANSACTIONID],[TRANSACTIONREFERENCE],[STATUSMESSAGE],[PLAN_TYPE],[PLANSTARTDATE],[PLANENDDATE]', 'email'),
(23, 'Payment failed', 'Maadima: PAYMENT FAILED', '<p>Dear <strong>[NAME]</strong></p>\n<p>You are receiving this email because you have done failed payment on the Maadima plateform.</p>\n<p>Please find failed payments detail below:</p>\n<p>Payment Details</p>\n<ul style="list-style-type: circle;">\n<li>Transaction Id:&nbsp;&nbsp;[TRANSACTIONID]</li>\n<li>Transaction Reference:&nbsp; &nbsp;[TRANSACTIONREFERENCE]</li>\n<li>Status Message:&nbsp; &nbsp;[STATUSMESSAGE]</li>\n</ul>\n<p>If you have any problem, please send an email to <strong>clientcare@maadima.com</strong> assistance</p>\n<p>For telephonic assistance; please call the Help Desk on 011 019 3100, during office hours:</p>\n<p>Monday to Thursday:&nbsp; &nbsp; &nbsp;<strong>08h00 to 17h00</strong><br />Fridays:&nbsp; &nbsp;<strong> 08h00 to 15h30</strong></p>\n<p>Thank you,<br />Maadima Anywhere</p>', '[NAME],[USER_EMAIL],[TRANSACTIONID],[TRANSACTIONREFERENCE],[STATUSMESSAGE]', 'email'),
(24, 'Welcome email', 'Maadima: WELCOME EMAIL', '<p>Dear [NAME]</p>\r\n<p>Thank you for registering and choosing Maadima for your business requirements. .</p>\r\n<p>You are receiving this email because an account was recently created for you on the Maadima app. <br /> <br /> Please find your login credential below :</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>Username:</p>\r\n</td>\r\n<td>\r\n<p>[USER_EMAIL]</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Password:</p>\r\n</td>\r\n<td>\r\n<p>[PASSWORD]</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>If you have any problems verifying your account, please send an email to <a href="mailto:help.cs@maadima.com">help.cs@maadima.com</a>&nbsp; for assistance.</p>\r\n<p>For telephonic assistance, please call the Support Desk 011 019 3100, during office hours:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>Monday to Thursday:</p>\r\n</td>\r\n<td>\r\n<p>08h00 to 17h00</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Fridays:</p>\r\n</td>\r\n<td>\r\n<p>08h00 to 15h30</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Sincerely,<br /> Maadima<br /> <br /> <strong>Help Desk</strong> <br /> 011 019 3100 <br /> <a href="mailto:help.cs@maadima.com">help.cs@maadima.com</a> &nbsp;&nbsp;</p>', '[NAME],[USER_EMAIL],[PASSWORD]', 'email'),
(28, 'Project Closer', 'Maadima: PROJECT CLOSER', '<p>Dear user</p>\r\n<p>Project : [PROJECTNAME]</p>\r\n<p>Above project is closed&nbsp; by&nbsp;[PARENTUSERNAME] .</p>\r\n<p><strong>Project Details</strong></p>\r\n<p>Project Description : &nbsp; [PROJECT]</p>\r\n<p>Address : &nbsp; [ADDRESS]</p>\r\n<p>Client : &nbsp; [CLIENT]</p>\r\n<p>Site Manager or Forman : &nbsp; [SITEMANAGER]</p>\r\n<p>If you have any problem, please send an email to <strong>clientcare@maadima.com</strong> assistance</p>\r\n<p>For telephonic assistance; please call the Help Desk on 011 019 3100, during office hours:</p>\r\n<p>Monday to Thursday:&nbsp; &nbsp; &nbsp;<strong>08h00 to 17h00</strong><br />Fridays:&nbsp; &nbsp;<strong> 08h00 to 15h30</strong></p>\r\n<p>Thank you,<br />Maadima Anywhere</p>', '[PARENTUSERNAME],[PARENTEMAIL],[ENDUSERNAME],[PROJECTNAME],[PROJECT],[ADDRESS],[CLIENT],[SITEMANAGER]', 'email'),
(27, 'New Diary Creation', 'Maadima: NEW DIARY CREATION', '<p>Dear <strong>[PARENTUSERNAME]</strong></p>\n<p>New diary is created by [ENDUSERNAME] .</p>\n<p>You are receiving this email because you are the client admin of the [ENDUSERNAME]</p>\n<p><b>PROJECT DETAILS</b></p>\n\n<hr>\n\n<p><b>Project name :</b> &nbsp; [PROJECTNAME]</p>\n\n<p><b>Project Description :</b> &nbsp; [PROJECT]</p>\n\n<p><b>DIARY DETAILS</b></p>\n\n<hr>\n\n<p><b>Weather: </b>&nbsp; [WEATHER]</p>\n\n<p><b>Visitors: </b>&nbsp; [VISITORS]</p>\n\n<p><b>Plant Hired :</b> &nbsp; [PLANTHIRED]</p>\n\n<p><b>Materials : </b>&nbsp; [MATERIALS]</p>\n\n<p><b>Work Progress :</b> &nbsp; [WORKPROGRESS]</p>\n\n<p><b>Delays : </b>&nbsp; [DELAYS]</p>\n\n<p><b>Inspection :</b> &nbsp; [INSPECTION]</p>\n\n<p><b>Accidents : </b>&nbsp; [ACCIDENTS]</p>\n\n<p><b>Instruction :</b> &nbsp; [INSTRUCTION]</p>\n\n<p>If you have any problem, please send an email to <strong>clientcare@maadima.com</strong> assistance</p>\n<p>For telephonic assistance; please call the Help Desk on 011 019 3100, during office hours:</p>\n<p>Monday to Thursday:&nbsp; &nbsp; &nbsp;<strong>08h00 to 17h00</strong><br />Fridays:&nbsp; &nbsp;<strong> 08h00 to 15h30</strong></p>\n<p>Thank you,<br />Maadima Anywhere</p>', ' [PARENTUSERNAME],[PARENTEMAIL],[ENDUSERNAME],[WEATHER],[VISITORS],[PLANTHIRED],[MATERIALS],[WORKPROGRESS],[DELAYS],[INSPECTION],[ACCIDENTS],[INSTRUCTION]', 'email'),
(26, 'New Project Creation', 'Maadima: NEW PROJECT CREATION', '<p>Dear <strong>[PARENTUSERNAME]</strong></p>\n<p>A new project is created now by [ENDUSERNAME] .</p>\n<p>You are receiving this email because you are the client admin of the [ENDUSERNAME]</p>\n<p><b>Project Details</b></p>\n\n<p>Project Name : &nbsp; [PROJECTNAME]</p>\n\n<p>Project Description : &nbsp; [PROJECT]</p>\n\n<p>Address : &nbsp; [ADDRESS]</p>\n\n<p>Client : &nbsp; [CLIENT]</p>\n\n<p>Site Manager or Forman : &nbsp; [SITEMANAGER]</p>\n\n<p>If you have any problem, please send an email to <strong>clientcare@maadima.com</strong> assistance</p>\n<p>For telephonic assistance; please call the Help Desk on 011 019 3100, during office hours:</p>\n<p>Monday to Thursday:&nbsp; &nbsp; &nbsp;<strong>08h00 to 17h00</strong><br />Fridays:&nbsp; &nbsp;<strong> 08h00 to 15h30</strong></p>\n<p>Thank you,<br />Maadima Anywhere</p>', '[PARENTUSERNAME],[PARENTEMAIL],[ENDUSERNAME],[PROJECTNAME],[PROJECT],[ADDRESS],[CLIENT],[SITEMANAGER]', 'email'),
(29, 'Project Updation ', 'Maadima: PROJECT UPDATION', '<p>Dear <strong>[PARENTUSERNAME]</strong></p>\n<p>This project is updated  by  [ENDUSERNAME] .</p>\n<p>You are receiving this email because you are the client admin of the [ENDUSERNAME]</p>\n<p><b>Project Details</b></p>\n\n<p>Project Name : &nbsp; [PROJECTNAME]</p>\n\n<p>Project Description : &nbsp; [PROJECT]</p>\n\n<p>Address : &nbsp; [ADDRESS]</p>\n\n<p>Client : &nbsp; [CLIENT]</p>\n\n<p>Site Manager or Forman : &nbsp; [SITEMANAGER]</p>\n\n<p>If you have any problem, please send an email to <strong>clientcare@maadima.com</strong> assistance</p>\n<p>For telephonic assistance; please call the Help Desk on 011 019 3100, during office hours:</p>\n<p>Monday to Thursday:&nbsp; &nbsp; &nbsp;<strong>08h00 to 17h00</strong><br />Fridays:&nbsp; &nbsp;<strong> 08h00 to 15h30</strong></p>\n<p>Thank you,<br />Maadima Anywhere</p>', '[PARENTUSERNAME],[PARENTEMAIL],[ENDUSERNAME],[PROJECTNAME],[PROJECT],[ADDRESS],[CLIENT],[SITEMANAGER]', 'email'),
(30, 'Diary Updation', 'Maadima: DIARY UPDATION', '<p>Dear <strong>[PARENTUSERNAME]</strong></p>\n<p>Diary is updated by [ENDUSERNAME] .</p>\n<p>You are receiving this email because you are the client admin of the [ENDUSERNAME]</p>\n<p><b>PROJECT DETAILS</b></p>\n\n<hr>\n\n<p><b>Project name :</b> &nbsp; [PROJECTNAME]</p>\n\n<p><b>Project Description :</b> &nbsp; [PROJECT]</p>\n\n<p><b>DIARY DETAILS</b></p>\n\n<hr>\n\n<p><b>Weather: </b>&nbsp; [WEATHER]</p>\n\n<p><b>Visitors: </b>&nbsp; [VISITORS]</p>\n\n<p><b>Plant Hired :</b> &nbsp; [PLANTHIRED]</p>\n\n<p><b>Materials : </b>&nbsp; [MATERIALS]</p>\n\n<p><b>Work Progress :</b> &nbsp; [WORKPROGRESS]</p>\n\n<p><b>Delays : </b>&nbsp; [DELAYS]</p>\n\n<p><b>Inspection :</b> &nbsp; [INSPECTION]</p>\n\n<p><b>Accidents : </b>&nbsp; [ACCIDENTS]</p>\n\n<p><b>Instruction :</b> &nbsp; [INSTRUCTION]</p>\n\n<p>If you have any problem, please send an email to <strong>clientcare@maadima.com</strong> assistance</p>\n<p>For telephonic assistance; please call the Help Desk on 011 019 3100, during office hours:</p>\n<p>Monday to Thursday:&nbsp; &nbsp; &nbsp;<strong>08h00 to 17h00</strong><br />Fridays:&nbsp; &nbsp;<strong> 08h00 to 15h30</strong></p>\n<p>Thank you,<br />Maadima Anywhere</p>', ' [PARENTUSERNAME],[PARENTEMAIL],[ENDUSERNAME],[WEATHER],[VISITORS],[PLANTHIRED],[MATERIALS],[WORKPROGRESS],[DELAYS],[INSPECTION],[ACCIDENTS],[INSTRUCTION]', 'email'),
(31, 'Enduser Account Deletion Email', 'Maadima: Account Deletion', '<p>Dear <strong>[NAME]</strong></p>\n<p>Your account is deleted by the adminstrator!</p>\n<p>If you have any problem, please send an email to <strong>clientcare@maadima.com</strong> assistance</p>\n<p>For telephonic assistance; please call the Help Desk on 011 019 3100, during office hours:</p>\n<p>Monday to Thursday:&nbsp; &nbsp; &nbsp;<strong>08h00 to 17h00</strong><br />Fridays:&nbsp; &nbsp;<strong> 08h00 to 15h30</strong></p>\n<p>Thank you,<br />Maadima Anywhere</p>', '[NAME]', 'email'),
(32, 'Project Assignments', 'Maadima: NEW PROJECT ASSIGNMENTS', '<p>Dear <strong>[PARENTUSERNAME]</strong></p>\r\n<p>A new project is created now by [ENDUSERNAME] .</p>\r\n<p>You are receiving this email because you are the client admin of the [ENDUSERNAME]</p>\r\n<p><b>Project Details</b></p>\r\n\r\n<p>Project Name : &nbsp; [PROJECTNAME]</p>\r\n\r\n<p>Project Description : &nbsp; [PROJECT]</p>\r\n\r\n<p>Address : &nbsp; [ADDRESS]</p>\r\n\r\n<p>Client : &nbsp; [CLIENT]</p>\r\n\r\n<p>Site Manager or Forman : &nbsp; [SITEMANAGER]</p>\r\n\r\n<p>If you have any problem, please send an email to <strong>clientcare@maadima.com</strong> assistance</p>\r\n<p>For telephonic assistance; please call the Help Desk on 011 019 3100, during office hours:</p>\r\n<p>Monday to Thursday:&nbsp; &nbsp; &nbsp;<strong>08h00 to 17h00</strong><br />Fridays:&nbsp; &nbsp;<strong> 08h00 to 15h30</strong></p>\r\n<p>Thank you,<br />Maadima Anywhere</p>', '[PARENTUSERNAME],[PARENTEMAIL],[ENDUSERNAME],[PROJECTNAME],[PROJECT],[ADDRESS],[CLIENT],[SITEMANAGER]', 'email');
